window.addEventListener("load",()=>{let e=document.querySelectorAll(".youtubeVideo");setTimeout(()=>{e.forEach(e=>{console.log("loading"),e.innerHTML=`<iframe src="https://www.youtube.com/embed/${e.dataset.videoid}" frameborder="0" allow="accelerometer; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>`,console.log("loaded")})},1e3)});